import React from 'react';
import imagezeta from '../../images/zetamonk_front.svg'
import {Landingsection,Imagewrapper,Image} from './LandingPage.element'
function LandingPage() {
    return (
      <Landingsection>
        <Imagewrapper>
        <Image src={imagezeta}>

        </Image>

        </Imagewrapper>
      </Landingsection>
    )
}

export default LandingPage
